import React from 'react';
import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar';
import { Route, Routes } from 'react-router-dom';
import Footer from './components/Footer';
import Posts from './components/Posts';
import Header from './components/Header';

function App() {
  return (
    <div className="App">
      <Header logoURL="https://www.google.com/url?sa=i&url=https%3A%2F%2Fangrybirds.fandom.com%2Fwiki%2FMinion_Pigs%2FSmall_Pig&psig=AOvVaw15diVp_Lz3NDURzfJ1nYkH&ust=1680317951994000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCJjtuauWhf4CFQAAAAAdAAAAABAD"
        title="Приложение"
      />
      <Navbar />
      <Routes>
        <Route path="pagination" element={<Posts count={100} limit={10}/>}></Route>
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
